// ObjectRecognition.js

import React, { useState, useEffect } from 'react';
import './ObjectRecognition.css';

function ObjectRecognition() {
  const [image, setImage] = useState(null);
  const [objects, setObjects] = useState([]);
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    // Initialize the object recognition model
    const model = new ObjectRecognitionModel();
    model.load().then(() => {
      console.log('Model loaded');
    });
  }, []);

  const handleImageChange = (event) => {
    setImage(event.target.files[0]);
  };

  const handleObjectRecognition = () => {
    setLoading(true);
    const model = new ObjectRecognitionModel();
    model.recognize(image).then((results) => {
      setObjects(results);
      setLoading(false);
    });
  };

  return (
    <div className="object-recognition">
      <h1>Object Recognition</h1>
      <input type="file" onChange={handleImageChange} />
      <button onClick={handleObjectRecognition}>Recognize Objects</button>
      {loading ? (
        <p>Loading...</p>
      ) : (
        <div className="object-detection">
          {objects.map((object, index) => (
            <div key={index} className="object">
              <img src={object.image} alt={object.name} />
              <div className="object-info">
                <span>{object.name}</span>
                <span>Confidence: {object.confidence}</span>
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
}

export default ObjectRecognition;
